import {ReleaseStyled} from './Release.styled';

const Release = (props) => {

  return (
    <ReleaseStyled>
      <h1>{props.header}</h1>
      <h2>{props.title}</h2>
      <img src={props.artwork} alt={props.artist}/>
      <h3>RELEASES FROM</h3>
      {props.artists.forEach(artist => <h2>{artist} + /</h2>)}
    </ReleaseStyled>
  )
}

export default Release
